{"time": "17:50 25/05/2020", "content": "THÔNG BÁO VỀ CA BỆNH 326 (BN326): Bệnh nhân nữ, 20 tuổi, là du học sinh Pháp, có địa chỉ tại Phường 19, Quận Bình Thạnh, TP. Hồ Chí Minh. Ngày 24/5, bệnh nhân từ Pháp về Sân bay Tân Sơn Nhất trên chuyến bay VN008, được cách ly ngay sau khi nhập cảnh tại Sư đoàn 317 huyện Hóc Môn, TP. Hồ Chí Minh. Cùng ngày bệnh nhân được lấy mẫu bệnh phẩm, kết quả xét nghiệm ngày 25/5 dương tính với SARS-CoV-2. Hiện bệnh nhân được cách ly, điều trị tại Bệnh viện Dã chiến Củ chi.", "link": "https://ncov.moh.gov.vn/web/guest/dong-thoi-gian/"}
